//V1
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./Pausable.sol";
import "./AccessControl.sol";
import "./SafeMath.sol";
import "./IERC20.sol";
import "./SafeERC20.sol";
import "./Math.sol";
import "./ISQFItem.sol";
// import "./IParaArt.sol";
// import "./IProxy.sol";

contract ParagonFactory is Pausable, AccessControl {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    ISQFItem public SQFi;
    // IParaArt public art;
    // IProxy public proxy;
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    uint256 public uncraftBurnPercent = 10;
    uint256 public minSQFI = 200;
    uint256 public maxSQFI = 2000;
    uint256[16] public runePower = [
        1,
        15,
        50,
        180,
        630,
        2200,
        7800,
        28220,
        105800,
        259200,
        665000,
        2200000
    ];

    address public fee1;
    // address public fee2;
    uint256 public amount1 = 100e18;
    // uint256 public amount2 = 100e18;

    event CraftSQFI(
        address owner,
        uint256 tokenId,
        address fee1,
        // address fee2,
        uint256 amount1
        // uint256 amount2
    );
    event UncraftSQFI(
        uint256 tokenId
    );
    event FeeChange(address currency, uint256 amount, bool enable);

    constructor(
        address _sqfi,
        // address _art,
        // address _proxy,
        address _fee1
        // address _fee2
    ) {
        // art = IParaArt(_art);
        // proxy = IProxy(_proxy);
        SQFi = ISQFItem(_sqfi);
        fee1 = _fee1;
        // fee2 = _fee2;
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(PAUSER_ROLE, msg.sender);
    }

    function editSQFI(uint256 _min, uint256 _max)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        minSQFI = _min;
        maxSQFI = _max;
    }

    function editUncraftBurnPercent(uint256 percent)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        require(percent <= 100, "Must be valid percent");
        uncraftBurnPercent = percent;
    }

    function bytes32ToAmount16(bytes32 data)
        public
        pure
        returns (uint256[16] memory amount)
    {
        for (uint8 i = 0; i < 32; i++) {
            amount[i / 2] =
                amount[i / 2] +
                uint8(data[i]) *
                256**(i % 2 == 0 ? 1 : 0);
        }
    }

    // function editRunePower(uint256[16] memory newPower)
    //     public
    //     onlyRole(DEFAULT_ADMIN_ROLE)
    // {
    //     runePower = newPower;
    // }

    function editSupportedFee(
        address _fee1,
        // address _fee2,
        uint256 _amount1
        // uint256 _amount2
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        fee1 = _fee1;
        // fee2 = _fee2;
        amount1 = _amount1;
        // amount2 = _amount2;
    }

    function createSQFI(
        // bytes32 originalArt,
        // bytes32 rawHashed,
        // bytes32 runesList
        string memory tokenURI_
    ) public whenNotPaused returns (uint256) {
        if (amount1 > 0 && fee1 != address(0x0)) {
            IERC20(fee1).transferFrom(msg.sender, address(this), amount1);
        }
        // if (amount2 > 0 && fee2 != address(0x0)) {
        //     IERC20(fee2).transferFrom(msg.sender, address(this), amount2);
        // }

        // art.copyrightUse(msg.sender, originalArt);
        // uint256[16] memory amount = bytes32ToAmount16(runesList);
        // uint256 totalRunes = 0;
        // for (uint256 i = 0; i < 16; i++) {
        //     if (amount[i] > 0) {
        //         totalRunes += amount[i];
        //         IERC20(proxy.getRuneAddress(i)).transferFrom(
        //             msg.sender,
        //             address(this),
        //             amount[i]
        //         );
        //     }
        // }
        // require(
        //     totalRunes >= minSQFI && totalRunes <= maxSQFI,
        //     "Must be 200 - 2000 runes have power"
        // );
        uint256 tokenId = SQFi.safeMint(
            msg.sender,
            tokenURI_
            // originalArt,
            // rawHashed,
            // runesList
        );
        emit CraftSQFI(
            // originalArt,
            // rawHashed,
            // runesList,
            msg.sender,
            tokenId,
            fee1,
            // fee2,
            amount1
            // amount2
        );
        return tokenId;
    }

    // The following functions are overrides required by Solidity.
    function uncraft(
        uint256 tokenId
    ) public virtual {
        (address owner,uint8 status, string memory tokenURI ) = SQFi
            .itemInfo(tokenId);
        // uint256[16] memory amount = bytes32ToAmount16(runesList);
        SQFi.burn(tokenId);
        emit UncraftSQFI(tokenId);
    }

    function withdraw(address token, uint256 amount)
        public
        onlyRole(DEFAULT_ADMIN_ROLE)
    {
        if (token == address(0x0)) {
            payable(msg.sender).transfer(amount);
        } else {
            IERC20(token).transfer(msg.sender, amount);
        }
    }
}

contracts/SQFITEM/ISQFItem.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface ISQFItem {
    function safeMint(
        address to,
        string memory tokenURI_
    ) external returns (uint256);

    function burn(uint256 tokenId) external;

    function paragonInfo(uint256 tokenId)
        external
        returns (
            address owner,
            bytes32 originalArt,
            bytes32 rawHashed,
            bytes32 runesList,
            uint8 status
        );
    function itemInfo(uint256 tokenId) 
    external
    returns(
            address owner,
            uint8 status,
            string calldata tokenURI
    );
}

